import React from 'react'

const Home = () => {
	const style = {
		sctnHomeContent: {
			background: 'rgb(43, 43, 43)',
			height: '100vh',
			width: '100%',
			position: 'fixed',
			top: '0px',
			left: '0px'
		},
		grauebloecke: {
			zIndex:4
		}
	}
	
	return (
		<div className="sctn sctn_home" style={style.section}>
			<h1 className="sctn_heading delayed-fallable" style={style.heading}>Willkommen!</h1>
			<div className="sctn_body">
				<div className="sctn_home_content" style={style.sctnHomeContent}>
					<div className="sctn_subheading">
						<span className="delayed-fallable greybg" style={style.grauebloecke}>Herzlich</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>willkommen</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>auf</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>meiner</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>Homepage!</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>Besuchen</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>Sie</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>mich</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>auch</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>in</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>meinem</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>Atelier</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>am</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>See</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>im</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>Amtshaus</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>Bad</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>Bederkesa</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>,</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>Amtsstr</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>.</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>8</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>,</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>27624</span> <span className="delayed-fallable greybg" style={style.grauebloecke}>Geestland</span>
					</div>
				</div>
			</div>
		</div>
	)
	
}

export default Home
